from depmap import data_access
from depmap.enums import BiomarkerEnum
import numpy as np


def get_value_labels_temp_hack(gene_series, value_labels, values):
    filtered_value_labels = []
    filtered_values = []
    for j, val_lab in enumerate(value_labels):
        if val_lab in gene_series.index.tolist():
            if values[j] is not np.nan and values[j] is not np.inf:
                filtered_value_labels.append(val_lab)
                filtered_values.append(values[j])

    return filtered_values, filtered_value_labels


def get_dataset_id_from_feature_type(feature_type: str):

    feature_type_to_dataset_id = {
        "Confounder": "crispr_confounders",
        "Lineage": "lineage",
        "GeneCN": "copy_number_relative",
        "MutationsDamaging": "mutations_damaging",
        "MutationsHotspot": "mutations_hotspot",
        "DriverEvents": BiomarkerEnum.OmicsLoH.name,
    }

    return feature_type_to_dataset_id[feature_type]


